import React from "react";
import GlobalStyle from './GlobalStyles';
import Home from "./assets/Pages/Home";
import Login from "./assets/Pages/Login";
import Register from "./assets/Pages/Register";
import CreateCard from "./assets/Pages/CreateCard";
import PrivateRoute from "./assets/Utils/PrivateRoute";
import CreateCategory from "./assets/Pages/CreateCategory";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import {AuthProvider} from "./assets/Pages/AuthContext";



function App() {
  return (
	<div className="App">
    	<Router>

			<GlobalStyle />
			<AuthProvider>
			<Switch>

				<Route exact path="/" component={Home} />
				<Route path="/login" component={Login} />
            	<Route path="/register" component={Register} />
				<PrivateRoute path="/createCard" component={CreateCard} />
				<Route path="/createCategory" component={CreateCategory} />
			</Switch>
			</AuthProvider>
		</Router>
	</div>
  );
}

export default App;
